import axios from "axios";

const Header = () => {
  const [users, setUsers] = useState([]);

  useEffect(async () => {
    const getData = async () => {
        const res = await axios.get('http://localhost:3000/users');
        setUsers(res.data);
    }

    getData();
  }, []);

